import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const CandidateProfile = () => {
  const navigate = useNavigate();
  const [candidateData, setCandidateData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetching JWT token from local storage (or session storage)
    const token = localStorage.getItem("token");

    if (!token) {
      setError("No authentication token found.");
      setLoading(false);
      return;
    }

    // Send the GET request with candidateId and JWT token
    axios
      .get("http://localhost:5000/voter/candidiate-details", {
        headers: {
          Authorization: `Bearer ${token}`, // JWT token in header
        },
        params: { candidateId: "CAND001" }, // Sending candidateId in the query parameters
      })
      .then((response) => {
        setCandidateData(response.data.candidate);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching candidate data:", error);
        setError("Failed to load candidate data.");
        setLoading(false);
      });
  }, []);

  const handleLogout = () => {
    // Clear the token and any session data
    localStorage.removeItem("jwtToken");
    navigate("/"); // Redirect to login page
  };

  const navigateToCastVote = () => {
    navigate("/cast-vote"); // Redirect to cast vote page
  };

  // Function to handle missing data
  const handleMissingData = (data) => {
    return data && data.length > 0 ? data.join(", ") : "Not mentioned";
  };

  if (loading) {
    return <div>Loading...</div>; // Show loading state until data is fetched
  }

  if (error) {
    return <div>{error}</div>; // Show error message if something went wrong
  }

  if (!candidateData) {
    return <div>No candidate data available.</div>;
  }

  const {
    firstName,
    lastName,
    gender,
    dateOfBirth,
    placeOfBirth,
    nationality,
    religion,
    maritalStatus,
    spouse,
    children,
    phoneNumber,
    email,
    socialMediaLinks,
    address,
    politicalBackground,
    education,
    personalInterestsAndHobbies,
    legalAndCriminalBackground,
    familyBackground,
  } = candidateData;

  return (
    <div style={styles.container}>
      {/* Header Section */}
      <header style={styles.header}>
        <h1 style={styles.title}>Pakistan Election Portal</h1>
        <nav style={styles.navbar}>
          <a href="#" style={styles.navLink}>Home</a>
          <a onClick={navigateToCastVote} href="#" style={styles.navLink}>Cast Vote</a>
          <a href="#" style={styles.navLink}>Election Results</a>
          <a href="#" style={styles.navLink}>Discussion Forums</a>
          <a href="#" style={styles.navLink}>Contact Us</a>
          <a onClick={handleLogout} href="#" style={styles.navLink}>Log Out</a>
        </nav>
      </header>

      {/* Candidate Profile Section */}
      <section style={styles.profileSection}>
        <h2 style={styles.profileTitle}>Candidate Profile</h2>
        <div style={styles.profileInfo}>
          <h3>Personal Details</h3>
          <p><strong>Full Name:</strong> {firstName} {lastName}</p>
          <p><strong>Gender:</strong> {gender}</p>
          <p><strong>Date of Birth:</strong> {new Date(dateOfBirth).toLocaleDateString()}</p>
          <p><strong>Place of Birth:</strong> {placeOfBirth}</p>
          <p><strong>Nationality:</strong> {nationality}</p>
          <p><strong>Religion:</strong> {religion}</p>
          <p><strong>Marital Status:</strong> {maritalStatus}</p>

          {/* Spouse Details */}
          <h4>Spouse</h4>
          <p><strong>Name:</strong> {spouse?.name || "Not mentioned"}</p>
          <p><strong>Date of Birth:</strong> {spouse?.dateOfBirth ? new Date(spouse.dateOfBirth).toLocaleDateString() : "Not mentioned"}</p>
          <p><strong>Occupation:</strong> {spouse?.occupation || "Not mentioned"}</p>

          {/* Children Details */}
          <h4>Children</h4>
          {children && children.length > 0 ? (
            children.map((child, index) => (
              <div key={index}>
                <p><strong>Name:</strong> {child.name}</p>
                <p><strong>Date of Birth:</strong> {new Date(child.dateOfBirth).toLocaleDateString()}</p>
                <p><strong>Occupation:</strong> {child.occupation}</p>
              </div>
            ))
          ) : (
            <p>Not mentioned</p>
          )}
          
          {/* Contact Details */}
          <h4>Contact</h4>
          <p><strong>Phone Number:</strong> {phoneNumber || "Not mentioned"}</p>
          <p><strong>Email:</strong> {email || "Not mentioned"}</p>

          {/* Social Media Links */}
          <h4>Social Media</h4>
          <p><strong>Twitter:</strong> {socialMediaLinks?.twitter || "Not mentioned"}</p>
          <p><strong>Facebook:</strong> {socialMediaLinks?.facebook || "Not mentioned"}</p>

          {/* Address */}
          <h4>Address</h4>
          <p><strong>Street:</strong> {address?.street || "Not mentioned"}</p>
          <p><strong>City:</strong> {address?.city || "Not mentioned"}</p>
          <p><strong>Province:</strong> {address?.province || "Not mentioned"}</p>
          <p><strong>Postal Code:</strong> {address?.postalCode || "Not mentioned"}</p>
          <p><strong>Country:</strong> {address?.country || "Not mentioned"}</p>

          {/* Political Background */}
          <h4>Political Background</h4>
          <p><strong>Party Membership:</strong> {politicalBackground?.partyMembership || "Not mentioned"}</p>
          {politicalBackground?.politicalPositionsHeld?.length > 0 ? (
            politicalBackground.politicalPositionsHeld.map((position, index) => (
              <div key={index}>
                <p><strong>Position:</strong> {position.positionTitle}</p>
                <p><strong>Duration:</strong> {position.duration}</p>
                <p><strong>Responsibilities:</strong> {position.responsibilities}</p>
              </div>
            ))
          ) : (
            <p>Not mentioned</p>
          )}

          {/* Education Background */}
          <h4>Education</h4>
          <p><strong>Subjects of Study:</strong> {handleMissingData(education.subjectsOfStudy)}</p>
          <p><strong>Other Certifications:</strong> {handleMissingData(education.otherCertifications)}</p>
          <p><strong>Academic Achievements:</strong> {handleMissingData(education.academicAchievements)}</p>

          {/* Legal Background */}
          <h4>Legal & Criminal Background</h4>
          <p><strong>Court Cases:</strong> {handleMissingData(legalAndCriminalBackground.courtCases)}</p>

          {/* Personal Interests & Hobbies */}
          <h4>Personal Interests & Hobbies</h4>
          <p><strong>Hobbies:</strong> {handleMissingData(personalInterestsAndHobbies.hobbies)}</p>
          <p><strong>Community Involvement:</strong> {handleMissingData(personalInterestsAndHobbies.communityInvolvement)}</p>

          {/* Family Background */}
          <h4>Family Background</h4>
          <p><strong>Siblings:</strong> {handleMissingData(familyBackground.siblings)}</p>
        </div>
      </section>

      {/* Footer Section */}
      <footer style={styles.footer}>
        <p style={styles.footerText}>© 2024 Pakistan Election Portal. All rights reserved.</p>
        <p style={styles.footerText}>Made with care for democracy.</p>
      </footer>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "'Roboto', sans-serif",
    color: "#1a2b2d",
    backgroundColor: "#ffffff",
    margin: 0,
    padding: 0,
    display: "flex",
    flexDirection: "column",
    minHeight: "100vh",
  },
  header: {
    backgroundColor: "#1a2b2d",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "20px",
  },
  title: {
    color: "#ffffff",
    fontSize: "28px",
    fontFamily: "'Roboto Slab', serif",
    margin: 0,
  },
  navbar: {
    display: "flex",
    gap: "15px",
  },
  navLink: {
    color: "#ffffff",
    textDecoration: "none",
    fontSize: "16px",
    fontWeight: "500",
  },
  profileSection: {
    padding: "50px 20px",
    backgroundColor: "#f9f9f9",
    textAlign: "left",
  },
  profileTitle: {
    fontSize: "32px",
    marginBottom: "20px",
    color: "#1a2b2d",
  },
  profileInfo: {
    fontSize: "16px",
    lineHeight: "1.6",
  },
  footer: {
    backgroundColor: "#1a2b2d",
    textAlign: "center",
    padding: "20px",
    color: "#ffffff",
    marginTop: "auto",
  },
  footerText: {
    fontSize: "14px",
    margin: "5px 0",
    fontWeight: "400",
  },
};

export default CandidateProfile;
